SET foreign_key_checks=0;


DROP DATABASE IF EXISTS Hospital;

CREATE DATABASE Hospital;

USE Hospital;

DROP TABLE IF EXISTS Patients;

CREATE TABLE Patients (
	Patient_ID INTEGER NOT NULL AUTO_INCREMENT,
    Name VARCHAR (25) NOT NULL, 
    Address VARCHAR (50) NOT NULL,
    Contact_number VARCHAR (50) NOT NULL,
    Insurance VARCHAR (50) NOT NULL,
	Ailment VARCHAR (500) NOT NULL,
    Gender VARCHAR (15) NOT NULL,
    AGE INTEGER NOT NULL,
    WEIGHT VARCHAR (15) NOT NULL, 
    Num_Visits INTEGER NOT NULL,
    PRIMARY KEY (Patient_ID));
    
DROP TABLE IF EXISTS Consultants;  
  
CREATE TABLE Consultants (
	Consultant_ID INTEGER NOT NULL AUTO_INCREMENT,
    Consultant_Name VARCHAR (50) NOT NULL,
    Contact_Number VARCHAR (50) NOT NULL,
    Cost DECIMAL (7,2) NOT NULL,
    Patient_ID INTEGER NOT NULL,
    Review_of_patient_condition VARCHAR (700) NOT NULL,
    PRIMARY KEY (Consultant_ID),
    FOREIGN KEY (Patient_ID) REFERENCES Patients (Patient_ID));
    
DROP TABLE IF EXISTS Nurses;
    
CREATE TABLE Nurses (
	Nurse_ID INTEGER NOT NULL AUTO_INCREMENT,
    Nurse_type VARCHAR (75) NOT NULL,
    Patient_ID INTEGER NOT NULL,
    Nurse_Name VARCHAR (50) NOT NULL,
    Contact_number VARCHAR (50) NOT NULL,    
    PRIMARY KEY (Nurse_ID),
    UNIQUE KEY `Nurse_type` (`Nurse_type`)
    );
    /*
    You can only have a foreign key referencing a unique field.
    Modify your network_classes table so that the category field is 
    unique
    */
    
    /*
	TO ADD A FOREIGN KEY TO AN EXISTING TABLE you can do this:
	  ALTER TABLE Patients
    ADD Ward_Id INTEGER NOT NULL
    DEFAULT 0,
    ADD CONSTRAINT fk_Ward_ID 
    FOREIGN KEY (Ward_Id)
    REFERENCES Wards (Ward_ID)
    ON DELETE CASCADE
    ON UPDATE CASCADE;
	*/
    
DROP TABLE IF EXISTS Wards;   
    
CREATE TABLE Wards (
	Ward_ID INTEGER NOT NULL AUTO_INCREMENT,
    Ward_Name VARCHAR (50)NOT NULL,
    Location VARCHAR (500) NOT NULL,
    Patient_ID INTEGER NOT NULL,
    Cost DECIMAL (7,2) NOT NULL,
    Ailment VARCHAR (500) NOT NULL,
    Nurse_type VARCHAR (75) NOT NULL,
    Ward_type VARCHAR (75) NOT NULL,
    Beds INTEGER NOT NULL,
    Nurse_ID INTEGER NOT NULL,
    PRIMARY KEY (Ward_ID),
    CONSTRAINT fk_Patient_Id
    FOREIGN KEY (Patient_ID)
    REFERENCES Patients (Patient_ID)
    ON DELETE CASCADE 
    ON UPDATE CASCADE,
    CONSTRAINT fk_Nurses_Id
    FOREIGN KEY (Nurse_ID)
    REFERENCES Nurses (Nurse_ID)
    ON DELETE CASCADE 
    ON UPDATE CASCADE
    );
    
    
	
   

DROP TABLE IF EXISTS Medicine;    
	    
CREATE TABLE Medicine (
	Medicine_ID INTEGER NOT NULL AUTO_INCREMENT,
    Medicine_Name VARCHAR (1000) NOT NULL,
    Cost DECIMAL (7,2),
    Consultant_Id INTEGER NOT NULL,
    Patient_Id INTEGER NOT NULL,
    
    Nurse_Id INTEGER NOT NULL,
    Nurse_Name VARCHAR (50) NOT NULL,
    Recommeneded_Dosage VARCHAR (50) NOT NULL,
    PRIMARY KEY (Medicine_ID),
    /*INDEX (Consultant_ID),
    INDEX (Patient_ID),
    INDEX (Nurse_Type),*/
    CONSTRAINT fk_consultant
    FOREIGN KEY (Consultant_Id) 
    REFERENCES Consultants (Consultant_ID)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
    CONSTRAINT fk_patient
    FOREIGN KEY (Patient_Id) 
    REFERENCES Patients (Patient_ID)
    ON DELETE CASCADE 
    ON UPDATE CASCADE,
    CONSTRAINT fk_nurse
    FOREIGN KEY (Nurse_Id) 
    REFERENCES Nurses (Nurse_ID) 
    ON DELETE CASCADE 
    ON UPDATE CASCADE  
    );
    
    
