/*

Foreign key relationships involve a parent table that holds
 the central data values, and a child table with identical values pointing back to its parent. 
The FOREIGN KEY clause is specified in the child table.
It will reject any INSERT or UPDATE operation that attempts to create a foreign key value in a 
child table if there is no a matching candidate key value in the parent table.
*/



